import React from "react";
import ReactDom from "react-dom";

const fName = "Vishal";
const lName = "lohemor";
const toDayDate = new Date();
const currentDate = `${toDayDate.getDate()}:${toDayDate.getMonth()}:${toDayDate.getFullYear()}`;
const currTime = `${toDayDate.getHours()}:${toDayDate.getMinutes()}:${toDayDate.getSeconds()}`; // => 9
const amPmStd = "";
let amPM = () => {
  if (toDayDate.getHours() > 12) {
    amPmStd = "PM";
  } else {
    amPmStd = "AM";
  }
};
amPM();
ReactDom.render(
  <>
    <h1>{`My name is ${fName} ${lName}`}</h1>
    <p>{`Today date is : ${currentDate}`}</p>
    <p>{`Current time is : ${currTime} `}</p>
  </>,
  document.getElementById("root")
);
